# SQLitePCL.pretty.Functions

These are extension functions for SQLite that can be added to a SQLite.pretty DB via the builder.

## Example

```
public SQLiteDatabaseConnection DbConnection
{
    get
    {
        if (_dbcon == null)
        {
            SQLiteDatabaseConnectionBuilder dbbuilder;
            if (_dbname == null)
                dbbuilder = SQLiteDatabaseConnectionBuilder
                        .InMemory;
            else
                dbbuilder = SQLiteDatabaseConnectionBuilder
                        .Create(_dbname);

            _dbcon = SQLitePCL.pretty.Functions.SqliteFn.Init(dbbuilder);
        }
        return _dbcon;
    }
}
```

We can now query SQLite using the functions in this library:

```
SELECT ISINT(5);
-- Returns 1

SELECT ISINT('X');
-- Returns 0
```

Easy read and write in your DB
      Simple to use: only 2 lines of code to read and write in SqlServer table!
      DataManager DM = new DataManager("dbname", "catalog", "username", "password");
      DataTable res = DM.getAllRecords("table to read");
      Thats all!
      More here http://MagicData.it/Documentazione/EsempioDataManager

